public void setEnable()
{
    boolean     isEditable;

    if(SPYEOSRunTable.PostedToLedger)
        isEditable = false;
    else
    {
        if(SPYEOSRunTable.WorkflowStatus == SPYWorkflowStatus::Created ||
           SPYEOSRunTable.WorkflowStatus == SPYWorkflowStatus::RequestChange)
            isEditable = true;
        else
            isEditable = false;
    }
    SPYEOSRunTable_ds.allowEdit(isEditable);
    SPYEOSRunTable_ds.allowDelete(isEditable);
    SPYEOSRunPayroll_ds.allowEdit(isEditable);
    SPYEOSRunPayroll_ds.allowDelete(isEditable);
    SPYEOSRunBenefit_ds.allowEdit(isEditable);
    SPYEOSRunBenefit_ds.allowDelete(isEditable);
    SPYEOSLedgerUpdateServiceController.enabled(!SPYEOSRunTable.PostedToLedger && SPYEOSRunTable.WorkflowStatus == SPYWorkflowStatus::Approved);
    SPYPayrollLedger.enabled(SPYEOSRunTable.PostedToLedger);
    SPYBenefitLedger.enabled(SPYEOSRunTable.PostedToLedger);
    SPYEOSRunPayrollServiceController.enabled(isEditable);
    SPYEOSRunBenefitServiceController.enabled(isEditable);
    SPYPayrollFinalizeProcessEOSServiceController.enabled(SPYEOSRunTable.PostedToLedger && !SPYEOSRunTable.IsFinalised);
}

public void init()
{
    super();

    if(SPYEOSRunTable.RecId)
    {
        SPYEOSRunTable_ds.query().dataSourceTable(tableNum(SPYEOSRunTable)).addRange(fieldNum(SPYEOSRunTable, RecId)).value(queryValue(SPYEOSRunTable.RecId));
    }

    element.setEnable();
}

public int active()
{
    int ret;

    ret = super();

    element.setEnable();
    element.setTitleText();

    return ret;
}

edit SPYAmount transactionCurrencyFinalAmount(boolean _set,SPYAmount _finalAmount)
{
    SPYAmount       ret;

    if(_set)
    {
        SPYEOSRunBenefit.AccountingCurPnLAmount = SPYEOSRunBenefit.AccountingCurrencyAmount - _finalAmount * SPYEOSRunBenefit.ExchRate / 100;
        SPYEOSRunBenefit.TransactionCurPnLAmount = SPYEOSRunBenefit.TransactionCurrencyAmount - _finalAmount;
        ret = _finalAmount;
    }
    else
    {
        ret = SPYEOSRunBenefit.TransactionCurrencyAmount;// - SPYEOSRunBenefit.AccountingCurPnLAmount;
    }

    return ret;
}

edit SPYAmount accountingCurrencyFinalAmount(boolean _set,SPYAmount _finalAmount)
{
    SPYAmount       ret;

    if(_set)
    {
        SPYEOSRunBenefit.AccountingCurPnLAmount = SPYEOSRunBenefit.AccountingCurrencyAmount - _finalAmount;
        SPYEOSRunBenefit.TransactionCurPnLAmount = SPYEOSRunBenefit.TransactionCurrencyAmount - _finalAmount;
        ret = _finalAmount;
    }
    else
    {
        ret = SPYEOSRunBenefit.AccountingCurrencyAmount;// - SPYEOSRunBenefit.AccountingCurPnLAmount;
    }

    return ret;
}

